        state.currentView.dateArray = dateArray
        if (state.currentView.dateIndex === null) state.currentView.dateIndex = dateArray.length - 1
        if (state.currentView.dateIndex > dateArray.length) state.currentView.dateIndex = 0
        state.currentView.currValues = dataset.loadedData[geoId].valuesByDate[state.currentView.dateIndex]
        updatePlotData()
        state.hasLoaded = true
        emitter.emit('render')
